  [],\n\t\"revision_timestamp\": \"2016-03-21T22:04:10.159217\",\n\t\"name\": \"igp2010-microbial-bacterial-community-profiling-at-sewage-treatment-plant-outfalls\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Penn Cove (in the Whidbey Basin) is designated
  as a category 5, 303d impaired water body due to low dissolved oxygen. In addition
  to runoff from adjacent developed and agricultural lands, treated effluent from
  two sewage treatment plants (STPs) and freshwater from the nearby Skagit River flow
  into Penn Cove. This project investigates the structure and function of microbial
  communities in the context of inorganic nutrients and physical parameters to assess
  any detectable influence of STPs.nnWork is conducted by NOAA personnel with assistance
  from undergraduate research interns. Data collected across four different seasons
  include bacterial/archeal abundance (biomass), heterotrophic production (productivity),
  bacterial diversity, chlorophyll A, inorganic nutrient concentrations, dissolved
  oxygen concentration, and seawater temperature.nnAnticipated products are presentations
  at scientific meetings related to marine dissolved oxygen and to local management
  authorities (e.g., county government) as well as publication in the referred literature.
  The project is a seed project to develop further capacity to assess additional low
  dissolved oxygen sites.nnFileMaker Pro of field & lab analyses.\",\n\t\"license_title\":
